import React from "react";
const Blog=(state)=>{

    const {handleChange,handleSubmit,items}=state;

const man = items.map(item=>{
    return(

    <div key={item.id}>
    <form  type="submit" onSubmit={handleSubmit}>
        <input type="text" placeholder="Add Course" onChange={handleChange}/>
        <input type="submit"  placeholder="Add Course" name="Add Course" />

    </form>
        </div>
)})

return(
        <div key={items.id}>{man}</div>
)

}
export default Blog;
